export const timeChange = (time) => {
  return {
    type: "TIME",
    payload: time,
  };
};

export const navToggle = (position) => {
  return {
    type: "POSITION",
    payload: position,
  };
};

export const setDisplay = (display) => {
  return {
    type: "DISPLAY",
    payload: display,
  };
};
